import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import Login from './components/Login';
import Register from './components/Register';
import DocumentCard from './components/DocumentCard';
import FolderCard from './components/FolderView';
import Settings from './components/Settings';
import SharedDocuments from './components/SharedDocuments';
import ActivityLog from './components/ActivityLog';
import { getCurrentUser } from './api/api';
import LoadingSpinner from './components/LoadingSpinner';
import ErrorBoundary from './components/ErrorBoundary';

function App() {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  useEffect(() => {
    checkAuth();
  }, []);

  const checkAuth = async () => {
    try {
      const token = localStorage.getItem('token');
      if (token) {
        const response = await getCurrentUser();
        setUser(response.data);
        setIsAuthenticated(true);
      }
    } catch (error) {
      console.error('Auth check failed:', error);
      localStorage.removeItem('token');
      setIsAuthenticated(false);
    } finally {
      setLoading(false);
    }
  };

  const handleLogin = (userData, token) => {
    localStorage.setItem('token', token);
    setUser(userData);
    setIsAuthenticated(true);
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    setUser(null);
    setIsAuthenticated(false);
  };

  if (loading) {
    return <LoadingSpinner />;
  }

  return (
    <ErrorBoundary>
      <div className="min-h-screen bg-gray-50">
        <Router>
          <Routes>
            {!isAuthenticated ? (
              <>
                <Route 
                  path="/login" 
                  element={<Login onLogin={handleLogin} />} 
                />
                <Route 
                  path="/register" 
                  element={<Register onRegister={handleLogin} />} 
                />
                <Route path="*" element={<Navigate to="/login" replace />} />
              </>
            ) : (
              <>
                <Route 
                  path="/" 
                  element={<Dashboard user={user} onLogout={handleLogout} />} 
                />
                <Route 
                  path="/documents" 
                  element={<Dashboard user={user} onLogout={handleLogout} />} 
                />
                <Route 
                  path="/documents/:id" 
                  element={<DocumentView user={user} onLogout={handleLogout} />} 
                />
                <Route 
                  path="/folders" 
                  element={<FolderView user={user} onLogout={handleLogout} />} 
                />
                <Route 
                  path="/folders/:id" 
                  element={<FolderView user={user} onLogout={handleLogout} />} 
                />
                <Route 
                  path="/shared" 
                  element={<SharedDocuments user={user} onLogout={handleLogout} />} 
                />
                <Route 
                  path="/activity" 
                  element={<ActivityLog user={user} onLogout={handleLogout} />} 
                />
                <Route 
                  path="/settings" 
                  element={<Settings user={user} onLogout={handleLogout} />} 
                />
                <Route path="*" element={<Navigate to="/" replace />} />
              </>
            )}
          </Routes>
        </Router>
      </div>
    </ErrorBoundary>
  );
}

export default App;
